INSERT INTO `ps_items2` (`iid`, `ithash`, `name`, `itdesc`, `img`, `sprice`, `cat`, `itflag`, `itmass`, `itsort`, `vis`) VALUES
	(1, 'd271551ab16346f38e28200ffe9b9f6d', 'Болоньезе', 'Соус из рубленного мяса с овощами и  итальянскими травами', 'index_files/mnsmzh42.jpg', 196, 3, 'new', 420, 0, 1),
	(2, 'f79291f273ea249eafed1c55c3a1577f', 'Карбонара', 'Поджаренный бекон с соусом из желтков, сливок и сыра пармезан.', 'index_files/pxmmte2d.jpg', 240, 3, 'hit', 400, 0, 1),
	(3, 'dbad8fe1d7e74b244f0b89c1fe5cb5d1', 'Прошутто Фунги', 'С ветчиной и шампиньонами в сливочном соусе', 'index_files/eulhsdft.jpg', 210, 3, 'none', 420, 0, 1),
	(4, '67fadeda57309bde53f2a7288b96e17c', 'Густо', 'Паста с ароматной свининой в базиликовом соусе песто со сливками', 'index_files/51th0r9u.jpg', 245, 3, 'none', 400, 0, 1),
	(5, 'cc68bdc900a0a2a0ea98be58ef8efb9e', 'Пиканте', 'Острая и ароматная паста с колбаской "Пепперони", свежим чили перцем и чесноком', 'index_files/hgaoeoo1esu2.jpg', 210, 3, 'hot', 420, 0, 1),
	(6, 'cc5084c9a1675a4af93aaf8dba497d34', 'Спиначи', 'Много сыра Дор-блю со шпинатом в сливках', 'index_files/5zqcqstp.jpg', 215, 3, 'none', 410, 0, 1),
	(7, '37d5b8cae6345d594ca070339efa2c9c', 'Индия', 'Ароматная паста с курицей, соусом карри, орехами кешью и болгарским перцем', 'index_files/tsrtpl19.jpg', 223, 3, 'none', 420, 0, 1),
	(8, 'ed795cb451049e21d6e28c1de1633cd3', 'Сицилиана', 'Вегетарианская паста с кабачком или баклажаном, оливками и сыром Моцарелла в томатном соусе', 'index_files/d8ztjx9j.jpg', 189, 3, 'none', 450, 0, 1),
	(9, '9b4a315a44db0a4ab1ebfb2622155151', 'Печенье "Овсянин"', '', 'index_files/ijfx1jd7.jpg', 108, 1, 'none', 0, 0, 1),
	(12, '8a6ef6372fb70e742ceb484908500866', 'Тархун', '', 'index_files/lemonade-estragon.jpg', 70, 1, 'none', 0, 0, 1),
	(13, '5d03969e095586a5009bbb1a3fe4ac66', 'Лазанья Болоньезе', 'Лазанья с классическим мясным соусом Болоньезе и соусом Бешамель под сыром пармезан', 'index_files/5uk012h0.jpg', 195, 4, 'new', 420, 0, 1),
