	(15, '42fa44c275b5c21e445280718ce16cd0', 'Лазанья Салмон', '', 'index_files/m5h4y9f2.jpg', 230, 4, 'none', 0, 0, 1),
	(16, '8bc5c46214ab8b4177ae7a42714e0698', 'Куриный бульон', 'Куриный бульон с домашней лапшой и куриной грудкой', 'index_files/oewzxoj8.jpg', 88, 5, 'hit', 400, 1, 1),
	(17, '88c0f8d8b5e3a0ca837937e1cbdf95d0', 'Сырный суп', 'Сырный суп с беконом и гренками', 'index_files/5sizuum2jqkj_list.jpg', 152, 5, 'none', 400, 0, 1),
	(18, 'b5c9ab1b4c1e4f238a7fb2e6861723d0', 'Грибной суп-крем', 'Шампиньоны, белые грибы, сыр и сливки. Не содержит картофеля.', 'index_files/ehl05w8vhong_list.jpg', 154, 5, 'none', 400, 0, 1),
	(20, '66063c63b1ac5a513c253450b90a880b', 'Мятный лимонад', '', 'index_files/lemonade-mint.jpg', 70, 1, 'none', 0, 0, 1),
	(21, '1a02c20c0189ab439f84e74c2b702f9d', 'Маринара', 'Отборные кальмары, мидии и осьминоги, тигровые креветки в томатном соусе с оливками', 'index_files/1bpi8pu8.jpg', 260, 3, 'none', 420, 0, 1),
	(22, '01fd41ac67e333348365f19b5f28ece3', 'Цезарь', 'Айсберг, сочная куриная грудка, черри, сухарики в настоящем соусе "Цезарь" с сыром пармезан', 'index_files/juc556y26too.jpg', 199, 6, 'hit', 270, 0, 1),
	(23, '89f929a4b52f894f4676c2b34994a23d', 'Лазанья 4 сыра', 'Моцарелла, пармезан, тильзитер и дор-блю с соусом бешамель и сливками', 'index_files/b6pc6i6z.jpg', 246, 4, 'none', 420, 0, 1),
	(24, 'a961539de6ea2b1a2bf8dfc8a5ea0fcd', 'Аль Фредо', 'Сочная курица, шампиньоны в нежном сливочном соусе с итальянскими травами.', 'index_files/78qgk2rp.jpg', 229, 3, 'hit', 430, 0, 1),
	(25, 'dcf0f7494100a7720519b148aa38e886', 'Имбирный лимонад', 'Яркий вкус имбиря с сиропом из лимона и лайма.', 'index_files/lemonade-jing.jpg', 75, 8, 'none', 500, 0, 1),
	(26, '86b78a323dbfe9909238fccd2d347cff', 'Натуральный лимонад', 'Домашний газированный лимонад из лимона и лайма.', 'index_files/lemonade-lime.jpg', 70, 8, 'none', 500, 0, 1),
	(28, 'f139e179dc6e1f514cdacc97b075fcd6', 'Салмон', 'Бережно обжаренные кусочки лосося в сливочном соусе со шпинатом.', 'index_files/upbssojo.jpg', 265, 3, 'none', 420, 0, 1),
